/* css styling */

html {
  scroll-behavior: smooth;
}

*,
::before,
::after {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  position: relative;
  margin: 0;
  font-family: "Trebuchet MS", "Lucida Sans Unicode", "Lucida Grande",
    "Lucida Sans", Arial, sans-serif;
  overflow-x: hidden;
}

.top-nav {
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  align-items: center;
  background-color: white;
  padding: 1rem;
  border-bottom: 4px solid #e0e0e0;
}

.logo {
  display: grid;
  place-items: center;
}
.logo-img {
  box-sizing: content-box;
  max-width: 200px;
}
/* nav-wrapper */
.nav-wrapper {
  display: flex;
  justify-content: flex-end;
  align-items: center;
}
.nav-wrapper a {
  float: right;
  color: #121212;
  text-align: center;
  padding: 0.2rem 0.5rem;
  margin: 0 0.5rem;
  text-decoration: none;
  font-size: 15px;
  font-weight: 600;
  transition: 0.3s ease-in-out;
}

.nav-wrapper .icon {
  display: none;
}

.dropdown {
  display: block;
}

.dropdown .dropbtn {
  padding: 0.2rem 0.5rem;
  margin: 0 0.5rem;
  transition: 0.3s ease-in-out;
  font-size: 15px;
  border: none;
  outline: none;
  color: #121212;
  background-color: inherit;
  font-weight: 600;
  cursor: pointer;
}

.dropdown-content {
  display: none;
  position: absolute;
  background-color: #f9f9f9;
  min-width: 150px;
  box-shadow: 0px 8px 16px 0px rgba(0, 0, 0, 0.2);
  z-index: 1;
}

.dropdown-content a {
  float: none;
  color: black;
  padding: 12px 16px;
  text-decoration: none;
  display: block;
  text-align: left;
  font-weight: 500;
}

.nav-wrapper a:hover,
.dropdown:hover .dropbtn {
  background-color: #555;
  color: white;
  transition: 0.3s ease-in-out;
}

.dropdown-content a:hover {
  background-color: #ddd;
  color: black;
}

.dropdown:hover .dropdown-content {
  display: block;
  border: 1px solid #ccc;
}

.header {
  width: 100%;
  background: #249;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
  padding: 2.3rem 2rem;
}
.header h2 {
  text-align: center;
  width: 100%;
  background: #249;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
  color: #fff;
  font-size: 44px;
  text-shadow: 2px 2px 4px #000000;
}
/* slideshow container */
.content {
  background-color: tomato;
  height: 100vh;
  display: flex;
  flex-flow: column;
}
.slider {
  width: 100%;
  min-height: 100vh;
  background-image: url("/ca91441deb50e2e9bb8a349c2cf42ccf.jpg");
  background-position: center center;
  background-size: cover;
  background-repeat: no-repeat;
}
.welcome {
  width: 100%;
  display: flex;
  flex: 1 1 auto;
  flex-wrap: wrap;
  padding: 3rem 2rem;
  margin: 2rem 0rem;
}
.welcome > p {
  width: 300px;
  padding: 3rem 2rem;
  display: flex;
  flex-wrap: wrap;
  border-radius: 6px;
  align-items: center;
  justify-content: center;
  flex: 1;
  font-size: large;
  margin: 1rem 2rem;
  transition: 0.4s ease-in-out;
  border: 1px solid #727272;
  text-align: justify;
}
.welcome > p:hover {
  box-shadow: 3px 3px 5px 1px #121212;
  background-color: #e0e0e0;
}
footer {
  width: 100%;
  margin-top: auto;
  background: #249;
  padding: 3rem 2rem;
  display: flex;
  flex-flow: column;
  align-items: center;
  text-align: center;
}
.contact-header {
  padding: 5px 0;
  margin-bottom: 2rem;
  border-bottom: 2px solid #fff;
}
#contact,
.contact-details {
  display: flex;
  flex-flow: column;
  align-items: center;
  color: white;
}
.contact-details p {
  font-size: 20px;
  color: white;
  margin: 0.5rem 0;
}

/* media queries */
@media only screen and (max-width: 600px) {
  .nav-wrapper a,
  .dropdown .dropbtn {
    display: none;
  }
  .nav-wrapper.responsive a,
  .dropdown .dropbtn {
    display: block;
  }
  .nav-wrapper a.icon {
    float: right;
    display: grid;
    place-items: center;
    position: fixed;
    right: 0;
    top: 50px;
  }
  .top-nav {
    padding: 0rem;
  }
  .nav-wrapper.responsive {
    background: #021318;
    padding: 1rem;
    position: absolute;
    top: 0;
    left: 0;
    margin: 0 auto;
    display: flex;
    flex-direction: column;
    align-items: flex-start;
    justify-content: space-between;
    flex: 1;
    width: 100%;
    height: 50%;
    transition: 0.3s ease-in-out;
    padding-right: 2rem;
  }
  .nav-wrapper.responsive .icon {
    position: absolute;
    right: 0;
    top: 0;
    color: white !important;
    transition: 0.3s ease-in-out;
  }
  .nav-wrapper.responsive a {
    transition: 0.3s ease-in-out;
    float: none;
    display: block;
    text-align: left;
    color: white;
  }
  .nav-wrapper.responsive .dropdown {
    float: none;
    display: block;
    text-align: left;
    transition: 0.3s ease-in-out;
  }
  .dropdown-content a {
    color: white !important;
    transition: 0.3s ease-in-out;
  }
  .dropdown-content a:hover {
    background: #ddd;
    color: black !important;
  }
  .dropdown:hover .dropdown-content {
    color: black;
  }
  .dropdown,
  .dropbtn,
  .dropdown-content {
    transition: 0.3s ease-in-out;
    color: white !important;
  }
  .nav-wrapper.responsive .dropdown-content {
    position: relative;
    margin-left: 20px;
    color: black !important;
  }
  .header h2 {
    font-size: 30px;
  }
}

